  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey has conducted
  geologic mapping to characterize the sea floor offshore of Massachusetts. The mapping
  was carried out using a Simrad Subsea EM 1000 Multibeam Echo Sounder on the Frederick
  G. Creed on four cruises conducted between 1994 and 1998. The mapping was conducted
  in cooperation with the National Oceanic and Atmospheric Administration (NOAA) and
  with support from the Canadian Hydrographic Service and the University of New Brunswick.
  The long-term goal of this mapping effort is to produce high-resolution geologic
  maps and a Geographic Information System (GIS) project that presents images and
  grids of bathymetry, shaded relief bathymetry, and backscatter intensity data from
  these surveys that will serve the needs of research, management and the public.\",\n\t\"license_title\":
